 const [activeLink, setActiveLink] = useState(0);

 const onClickHandler =()=> {
  console.log("задіяно кнопку");
    setLoading(true);
    axios.get('https://randomuser.me/api/')
    .then(response =>{
      console.log(response.data.results);
      setUserData(response.data.results);
